uage/6/\"},\"version\":{\"name\":\"x\",\"url\":\"https://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"Cuando lanza una descarga de fuego supercaliente, la\\nroja llama de su cola brilla más intensamente.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"x\",\"url\":\"https://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"Quando emette le sue lingue di fuoco, la fiamma\\nrossa sulla punta della coda brucia più intensamente.\",\"language\":{\"name\":\"it\",\"url\":\"https://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"x\",\"url\":\"https://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"When expelling a blast of superhot fire,\\nthe red flame at the tip of its tail burns\\nmore intensely.\",\"language\":{\"name\":\"en\",\"url\":\"https://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"x\",\"url\":\"https://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"口から　灼熱の　炎を　吐き出すとき\\n尻尾の　先は\\nより　赤く　激しく　燃え上がる。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"x\",\"url\":\"https://pokeapi.co/api/v2/version/23/\"}},{\"flavor_text\":\"ちじょう　１４００メートル　まで\\nハネを　つかって　とぶことができる。\\nこうねつの　ほのおを　はく。\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"지상 1400m까지\\n날개를 사용해 날 수 있다.\\n고열의 불꽃을 내뿜는다.\",\"language\":{\"name\":\"ko\",\"url\":\"https://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Ses ailes peuvent le faire voler à plus de 1 400 m\\nd’altitude. Ce Pokémon crache du feu à des\\ntempératures très élevées.\",\"language\":{\"name\":\"fr\",\"url\":\"https://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Dieses Pokémon kann mit seinen Flügeln\\neine Höhe von bis zu 1 400 m erreichen.\\nEs spuckt sehr heißes Feuer.\",\"language\":{\"name\":\"de\",\"url\":\"https://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Con las alas que tiene puede alcanzar una altura de\\ncasi 1400 m. Suele escupir fuego por la boca.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Grazie alle possenti ali può volare fino a 1400 m\\nd’altezza. Sputa fuoco a una temperatura\\nimpressionante.\",\"language\":{\"name\":\"it\",\"url\":\"https://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"Its wings can carry this Pokémon close to an\\naltitude of 4,600 feet. It blows out fire at very\\nhigh temperatures.\",\"language\":{\"name\":\"en\",\"url\":\"https://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"地上　１４００メートルまで\\n羽を　使って　飛ぶことができる。\\n高熱の　炎を　吐く。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"y\",\"url\":\"https://pokeapi.co/api/v2/version/24/\"}},{\"flavor_text\":\"つよい　あいてを　もとめて　そらを　とびまわる。\\nなんでも　とかして　しまう　こうねつの　ほのおを\\nじぶんより　よわいものに　むけることは　しない。\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"강한 상대를 찾아 하늘을 날아다닌다.\\n무엇이든 다 녹여버리는 고열의 불꽃을\\n자신보다 약한 자에게 들이대지 않는다.\",\"language\":{\"name\":\"ko\",\"url\":\"https://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"Dracaufeu parcourt les cieux pour trouver des adversaires\\nà sa mesure. Il crache de puissantes flammes capables de\\nfaire fondre n’importe quoi. Mais il ne dirige jamais son souffle\\ndestructeur vers un ennemi plus faible.\",\"language\":{\"name\":\"fr\",\"url\":\"https://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"Glurak fliegt durch die Lüfte, um starke Gegner aufzuspüren.\\nSein heißer Feueratem bringt alles zum Schmelzen. Aber es\\nrichtet seinen Feueratem nie auf schwächere Gegner.\",\"language\":{\"name\":\"de\",\"url\":\"https://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"Charizard se dedica a volar por los cielos en busca de\\noponentes fuertes. Echa fuego por la boca y es capaz de\\nderretir cualquier cosa. No obstante, si su rival es más débil\\nque él, no usará este ataque.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"Charizard solca i cieli in cerca di nemici molto forti.\\nRiesce a emettere fiammate di un calore tale da fondere\\nogni cosa. Tuttavia, non rivolge mai le sue micidiali lingue\\ndi fuoco contro avversari più deboli di lui.\",\"language\":{\"name\":\"it\",\"url\":\"https://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"Charizard flies around the sky in search of powerful opponents.\\nIt breathes fire of such great heat that it melts anything.\\nHowever, it never turns its fiery breath on any opponent\\nweaker than itself.\",\"language\":{\"name\":\"en\",\"url\":\"https://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"強い　相手を　求めて　空を　飛び回る。\\nなんでも　溶かして　しまう　高熱の　炎を\\n自分より　弱いものに　向けることは　しない。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"omega-ruby\",\"url\":\"https://pokeapi.co/api/v2/version/25/\"}},{\"flavor_text\":\"つよい　あいてを　もとめて　そらを　とびまわる。\\nなんでも　とかして　しまう　こうねつの　ほのおを\\nじぶんより　よわいものに　むけることは　しない。\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"alpha-sapphire\",\"url\":\"https://pokeapi.co/api/v2/version/26/\"}},{\"flavor_text\":\"강한 상대를 찾아 하늘을 날아다닌다.\\n무엇이든 다 녹여버리는 고열의 불꽃을\\n자신보다 약한 자에게 들이대지 않는다.\",\"language\":{\"name\":\"ko\",\"url\":\"https://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"alpha-sapphire\",\"url\":\"https://pokeapi.co/api/v2/version/26/\"}},{\"flavor_text\":\"Dracaufeu parcourt les cieux pour trouver des adversaires\\nà sa mesure. Il crache de puissantes flammes capables de\\nfaire fondre n’importe quoi. Mais il ne dirige jamais son souffle\\ndestructeur vers un ennemi plus faible.\",\"language\":{\"name\":\"fr\",\"url\":\"https://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"alpha-sapphire\",\"url\":\"https://pokeapi.co/api/v2/version/26/\"}},{\"flavor_text\":\"Glurak fliegt durch die Lüfte, um starke Gegner aufzuspüren.\\nSein heißer Feueratem bringt alles zum Schmelzen. Aber es\\nrichtet seinen Feueratem nie gegen schwächere Gegner.\",\"language\":{\"name\":\"de\",\"url\":\"https://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"alpha-sapphire\",\"url\":\"https://pokeapi.co/api/v2/version/26/\"}},{\"flavor_text\":\"Charizard se dedica a volar por los cielos en busca de\\noponentes fuertes. Echa fuego por la boca y es capaz de\\nderretir cualquier cosa. No obstante, si su rival es más débil\\nque él, no usará este ataque.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"alpha-sapphire\",\"url\":\"https://pokeapi.co/api/v2/version/26/\"}},{\"flavor_text\":\"Charizard solca i cieli in cerca di nemici molto forti.\\nRiesce a emettere fiammate di un calore 