Wenn es einen Strahl glühenden Feuers speit,\\nlodert die rote Flamme an seiner Schwanzspitze\\nnoch intensiver.\",\"language\":{\"name\":\"de\",\"url\":\"https://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"lets-go-pikachu\",\"url\":\"https://pokeapi.co/api/v2/version/31/\"}},{\"flavor_text\":\"Cuando exhala fuego abrasador, la llama de la\\npunta de la cola se aviva y adquiere un intenso\\ncolor rojo.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"lets-go-pikachu\",\"url\":\"https://pokeapi.co/api/v2/version/31/\"}},{\"flavor_text\":\"Quando emette lingue di fuoco roventi\\ndalla bocca, la fiamma rossa sulla punta\\ndella coda brucia più intensamente.\",\"language\":{\"name\":\"it\",\"url\":\"https://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"lets-go-pikachu\",\"url\":\"https://pokeapi.co/api/v2/version/31/\"}},{\"flavor_text\":\"When this Pokémon expels a blast of superhot\\nfire, the red flame at the tip of its tail burns\\nmore intensely.\",\"language\":{\"name\":\"en\",\"url\":\"https://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"lets-go-pikachu\",\"url\":\"https://pokeapi.co/api/v2/version/31/\"}},{\"flavor_text\":\"口から　灼熱の　炎を\\n吐き出すとき　シッポの先は\\nより　赤く　激しく　燃えあがる。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"lets-go-pikachu\",\"url\":\"https://pokeapi.co/api/v2/version/31/\"}},{\"flavor_text\":\"从口中喷出灼热的火焰时，\\n尾巴尖端的红色火焰\\n会燃烧得更加猛烈。\",\"language\":{\"name\":\"zh-Hans\",\"url\":\"https://pokeapi.co/api/v2/language/12/\"},\"version\":{\"name\":\"lets-go-pikachu\",\"url\":\"https://pokeapi.co/api/v2/version/31/\"}},{\"flavor_text\":\"くちから　しゃくねつの　ほのおを\\nはきだすとき　シッポのさきは\\nより　あかく　はげしく　もえあがる。\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"lets-go-eevee\",\"url\":\"https://pokeapi.co/api/v2/version/32/\"}},{\"flavor_text\":\"입에서 작렬하는 불꽃을\\n토해낼 때 꼬리의