あがる。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"lets-go-eevee\",\"url\":\"https://pokeapi.co/api/v2/version/32/\"}},{\"flavor_text\":\"从口中喷出灼热的火焰时，\\n尾巴尖端的红色火焰\\n会燃烧得更加猛烈。\",\"language\":{\"name\":\"zh-Hans\",\"url\":\"https://pokeapi.co/api/v2/language/12/\"},\"version\":{\"name\":\"lets-go-eevee\",\"url\":\"https://pokeapi.co/api/v2/version/32/\"}},{\"flavor_text\":\"がんせきも　やけるような\\nしゃくねつの　ほのおを　はいて\\nやまかじを　おこすことが　ある。\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"암석도 태워버릴 정도로\\n작열하는 화염을 뿜어\\n산불을 일으킬 때가 있다.\",\"language\":{\"name\":\"ko\",\"url\":\"https://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"會噴出彷彿連岩石\\n都能燒焦的灼熱火焰。\\n有時會引發森林火災。\",\"language\":{\"name\":\"zh-Hant\",\"url\":\"https://pokeapi.co/api/v2/language/4/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"Son souffle brûlant peut faire fondre la roche.\\nIl est parfois la cause d’incendies de forêt.\",\"language\":{\"name\":\"fr\",\"url\":\"https://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"Dieses Pokémon kann mit seinem Feueratem\\nFelsen schmelzen. Es verursacht ab und zu\\nWaldbrände.\",\"language\":{\"name\":\"de\",\"url\":\"https://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"Escupe un fuego tan caliente que funde las rocas.\\nCausa incendios forestales sin querer.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"Sputa fiamme incandescenti in grado di fondere\\nle rocce. A volte causa incendi boschivi.\",\"language\":{\"name\":\"it\",\"url\":\"https://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"It spits fire that is hot enough to melt boulders.\\nIt may cause forest fires by blowing flames.\",\"language\":{\"name\":\"en\",\"url\":\"https://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"岩石も　焼けるような\\n灼熱の　炎を　吐いて\\n山火事を　起こすことが　ある。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"能够喷出猛烈的火焰，\\n仿佛连岩石都能烤焦。\\n有时会引发森林火灾。\",\"language\":{\"name\":\"zh-Hans\",\"url\":\"https://pokeapi.co/api/v2/language/12/\"},\"version\":{\"name\":\"sword\",\"url\":\"https://pokeapi.co/api/v2/version/33/\"}},{\"flavor_text\":\"ちじょう　１４００メートル　まで\\nハネを　つかって　とぶことができる。\\nこうねつの　ほのおを　はく。\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"지상 1400m까지\\n날개를 사용해 날 수 있다.\\n고열의 불꽃을 내뿜는다.\",\"language\":{\"name\":\"ko\",\"url\":\"https://pokeapi.co/api/v2/language/3/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"能用翅膀飛到距離地面\\n１４００公尺的高度。\\n會吐出高溫的火焰。\",\"language\":{\"name\":\"zh-Hant\",\"url\":\"https://pokeapi.co/api/v2/language/4/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"Ses ailes lui permettent de voler à plus de\\n1 400 m d’altitude. Ce Pokémon crache du feu\\nà des températures très élevées.\",\"language\":{\"name\":\"fr\",\"url\":\"https://pokeapi.co/api/v2/language/5/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"Dieses Pokémon kann mit seinen Flügeln eine\\nHöhe von bis zu 1 400 m erreichen. Es spuckt\\nsehr heißes Feuer.\",\"language\":{\"name\":\"de\",\"url\":\"https://pokeapi.co/api/v2/language/6/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"Sus potentes alas le permiten volar a una altura\\nde 1400 m. Escupe llamaradas que llegan a\\nalcanzar temperaturas elevadísimas.\",\"language\":{\"name\":\"es\",\"url\":\"https://pokeapi.co/api/v2/language/7/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"Grazie alle possenti ali può volare fino a\\n1.400 m d’altezza. Le fiamme che sputa\\npossono raggiungere temperature altissime.\",\"language\":{\"name\":\"it\",\"url\":\"https://pokeapi.co/api/v2/language/8/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"Its wings can carry this Pokémon close to an\\naltitude of 4,600 feet. It blows out fire at very\\nhigh temperatures.\",\"language\":{\"name\":\"en\",\"url\":\"https://pokeapi.co/api/v2/language/9/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"地上　１４００メートル　まで\\n羽を　使って　飛ぶことができる。\\n高熱の　炎を　吐く。\",\"language\":{\"name\":\"ja\",\"url\":\"https://pokeapi.co/api/v2/language/11/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}},{\"flavor_text\":\"能用翅膀飞到距地面\\n１４００米的高度。\\n会吐出高温火焰。\",\"language\":{\"name\":\"zh-Hans\",\"url\":\"https://pokeapi.co/api/v2/language/12/\"},\"version\":{\"name\":\"shield\",\"url\":\"https://pokeapi.co/api/v2/version/34/\"}}],\"form_descriptions\":[],\"forms_switchable\":true,\"gender_rate\":1,\"genera\":[{\"genus\":\"かえんポケモン\",\"language\":{\"name\":\"ja-Hrkt\",\"url\":\"https://pokeapi.co/api/v2/language/1/\"}},{\"genus\":\"화염포켓몬\",\"language\":{\"name\":\"ko\",\"url\":\"https://pokeapi.co/api/v2/language/3/\"}},{\"genus